import { useNavigate } from "react-router";

const MyUserProfile = ({storage,fetchUser}) => {
const currUser = storage.getItem("currUserProfile");
console.log(currUser.first_name);



const getUser = async(userId) => {
    const response = await fetchUser(userId);
    console.log(response);
    storage.setItem("otherUser",response.user_id);
    if (response.first_name){
      navigate(`/signed-in/feed/user/${userId}`);
    }
  }

return (
    <>
    <div>
    <h1>Name:</h1>
    <h2>{currUser.first_name} {currUser.last_name}</h2>
    </div>
    </>
)


}

export default MyUserProfile;
